  [],\n\t\"revision_timestamp\": \"2016-02-20T15:07:51.327942\",\n\t\"name\": \"it-performance-dashboard-service-level-agreement-sla-dashboard\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The IT Performance Dashboard is a trusted
  source for IT performance information across VA. This is available only on the VA
  intranet.  The dashboard is a collection of information from Regions, VISNs, Facilities,
  and other VA offices across a range of departments within the Office of Information
  & Technology (OIT)u00efu00bfu00bdfrom Product Development and Information Security
  to Human Resources to Finance. It presents often-complex information in easy-to-understand
  dashboard reports.rnCurrently, you can see performance reports relating to Customer
  Service, Service Level Agreements (SLAs), Systems, Monthly Performance Reports (MPR),
  IT Assets and Debt Score, Human Resources, and Network/Security. There is also a
  Facility CIO Center tab where you can see Quarterly Performance Reviews, an OIT
  Daily Brief tab where you can access OIT Daily Brief Reports, and a Product Delivery
  tab that takes you to the PMAS Dashboard. As the IT Performance Dashboard continues
  to evolve, you will be able to see a broader range of performance information u00efu00bfu00bd
  including custom reports, upon request.rnThis page displays the Service Level Agreement
  (SLA) Reports on the IT Dashboard:rnu00efu00bfu00bdtAdministrative Data Repository
  Availability:  This report displays the percentage of total monthly availability
  for the ADR system. The ADR system is the primary My HealtheVet (MHV) data store
  that serves as the authoritative source for MHV application demographic, identity
  management, and eligibility/enrollment information for all clinical patients and
  administrative staff.rnu00efu00bfu00bdtAbandonment Rate:  This report captures and
  reflects the percentage of callers that disconnect the call before having their
  call answered. Clicking on any of the lines on the chart denoting Regions will enable
  the user to drill down and view the Campus level data.rnu00efu00bfu00bdtExchange
  Availability:  This report provides server availability for all the Exchange servers.
  Clicking on any of the lines on the chart denoting Regions will enable the user
  to drill down and view the server level data. In April-May 2014, we (ITPD team)
  discovered three servers in VISN 9 that were reporting less than 50% availability.
  We looked into these servers with the Exchange team and learned that they were not
  configured properly for SCOM. The Exchange team has resolved the issue as of April
  20th and these servers are now reporting as they should. If you have questions please
  do not hesitate to contact us.rnu00efu00bfu00bdtVitria Interface Engine Availability:
  \ This report displays the percentage of total monthly availability for the enterprise
  VIE, which is used for the reliable and timely transmission of data between VistA
  and other systems.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
